import Profile from "./components/Profile";
import LightNavbar from "./components/Navbar";
import "bootstrap/dist/css/bootstrap.min.css";
import Landing from "./components/Landing";
import { useAuth0 } from "@auth0/auth0-react";
import LoadingSpinner from "./components/LoadingSpinner";
import { Route, Router, Routes } from "react-router-dom";

function App() {
  const { isLoading, error, isAuthenticated } = useAuth0();

  if (error) {
    return <p>Authentication Error</p>;
  }

  if (isLoading) {
    return <LoadingSpinner />;
  }

  return (
    <Router>
      <Routes>
        <Route path="/" element={isAuthenticated ? <Profile /> : <Landing />} />
        <Route path="/profile" element={isAuthenticated ? <Profile /> : <Landing />} />
        <Route path="/learn" element={<div>Learn Page Coming Soon</div>} />
        <Route path="/tutors" element={<div>Tutors Page Coming Soon</div>} />
      </Routes>
    </Router>
  );
}

export default App;
